import React, {useEffect,useState} from 'react'
import 'bootstrap/dist/css/bootstrap.min.css';
import { Col, Nav, Row ,Tab, Container, Image,} from "react-bootstrap";
import { HiHome } from "react-icons/hi";
import { MdEqualizer, MdList,  } from "react-icons/md";
import { AiFillSchedule } from "react-icons/ai";
import  '../../css/SystemAdmin.css';

function SideNavBar(props) {

    const [dashboard, setdashboard] = useState();
    const [pets, setpets] = useState();
    const [appointment, setappointment] = useState();
    const [mycart, setmycart] = useState();
    const [visitormonitoring, setvisitormonitoring] = useState();
    const [onclickManagement, setonclickManagement] = useState(true);
  
    // useEffect(() => {
    //   if (props.active === "dashboard") {
    //     setdashboard("#19B9CC");
    //   } else if (props.active === "pets") {
    //     setpets("#19B9CC");
    //   } else if (props.active === "appointment") {
    //     setappointment("#19B9CC");
    //   } else if (props.active === "mycart") {
    //     setmycart("#19B9CC");
    //   } else if (props.active === "visitormonitoring") {
    //     setvisitormonitoring("#19B9CC");
    //   }
    // }, []);
    return (
        <div>

<Row>
    <Col sm={2}>
    <div id="sideNavBar">
     
        <Container
          id="ContainerNavItem"
          style={{
            backgroundColor: dashboard,
            marginTop:50
          }}
        >
          <a id="anchorTag" href="/">
            <HiHome id="icons" />
            Dashboard
          </a>
        </Container>
  
        <Container
          id="ContainerNavItem"
          style={{
            backgroundColor: pets,
            cursor:'pointer'
          }}
          onClick={() =>
            setonclickManagement(!onclickManagement)
          }
        >
          <MdList id="icons" />
          <p id="anchorTag" >
           Management
          </p>
        </Container>
  
  <div hidden={onclickManagement}> 
        <Container
          id="ContainerNavItem"
          style={{
            backgroundColor: appointment,
          }}
        >
          
          <a id="anchorTag" href="/appointment" 
          style={{marginLeft:'35%'}}>
            Users
          </a>
        </Container>
  
        <Container
          id="ContainerNavItem"
          style={{
            backgroundColor: mycart,
          }}
        >
          
          <a id="anchorTag" href="/my&cart" 
          style={{marginLeft:'35%'}}>
            Products & Orders
          </a>
        </Container>
  
        <Container
          id="ContainerNavItem"
          style={{
            backgroundColor: visitormonitoring,
          }}
        >
         
          <a id="anchorTag" href="/contact&tracing" 
          style={{marginLeft:'35%'}}>
            Exhibits
          </a>
        </Container>

        </div>
        <Container
          id="ContainerNavItem"
          style={{
            backgroundColor: visitormonitoring,
          }}
        >
          <MdEqualizer id="icons" />
          <a id="anchorTag" href="/contact&tracing">
            Reports
          </a>
        </Container>
  
        <hr />
       
      </div>
    </Col>

    <Col sm={10}>
    sdasdadsda
    </Col>
    </Row>
        
        
      
      </div>
    );
  }

export default SideNavBar
